/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER before_active_insert
BEFORE INSERT
ON ActiveCustomerLiveToRooms 
FOR EACH ROW
BEGIN
	
    DECLARE cost int;
    
    set cost = (
				select ChargePerDay from Room
                where idRoom=new.idRoom
		);
        
	set new.LeavingDatetime = date_add(new.ArrivalDatetime, interval 7 day);
    
    set new.TotalBill = new.TotalBill + cost*datediff(new.LeavingDatetime, new.ArrivalDatetime);
    
    
    
    
END */;;
DELIMITER ;
